    public static int numJewelsInStones(String J, String S) {
        int count = 0;
        for (int i = 0; i < J.length(); i++) {
            for (int j = 0; j < S.length(); j++) {
                if (J.charAt(i) == S.charAt(j)) count++;
            }
        }
        return count;
    }

    public boolean lemonadeChange(int[] bills) {
        int fiveDollar = 0;
        int tenDollar = 0;
        for (int i = 0; i < bills.length; i++) {
            if (bills[i] == 5) {
                fiveDollar++;
            } else if (bills[i] == 10) {
                if (fiveDollar > 0) {
                    fiveDollar--;
                    tenDollar++;
                } else {
                    return false;
                }
            } else {
                if (fiveDollar >= 3) {
                    fiveDollar -= 3;
                } else if (tenDollar > 0 && fiveDollar > 0) {
                    tenDollar--;
                    fiveDollar--;
                } else return false;

            }

        }
        return true;
    }

    public static List<String> fizzBuzz(int n) {
        List<String> str = new ArrayList();
        for (int i = 1; i <= n; i++) {
            boolean dev3 = (i % 3 == 0);
            boolean dev5 = (i % 5 == 0);

            if (dev5 && dev3) {
                str.add("FizzBuzz");

            } else if (dev3) {
                str.add("Fizz");
            } else if (dev5) {
                str.add("Buzz");
            } else {
                str.add(Integer.toString(i));
            }
        }
        return str;
    }

    public static int lengthOfLastWord(String s) {
        String[] str = s.split("");
        int count = 0;
        boolean newline = false;
        if (str.length < 1) {
            return 0;
        }
        for (String s1 : str) {
            if (s1.equals(" ")) {
                newline = true;
            } else {
                if (newline) {
                    count = 0;
                    newline = false;
                }
                count++;
            }
        }

        return count;

    }

    public static int thirdMax(int[] nums) {
        Integer firstMaximum = null;
        Integer secondMaximum = null;
        Integer thirdMaximum = null;
        for (int i = 0; i < nums.length; i++) {
            if (firstMaximum == null || nums[i] > firstMaximum) {
                thirdMaximum = secondMaximum;
                secondMaximum = firstMaximum;
                firstMaximum = nums[i];
            } else if (nums[i] == firstMaximum) {
                continue;
            } else if (secondMaximum == null || nums[i] > secondMaximum) {
                thirdMaximum = secondMaximum;
                secondMaximum = nums[i];
            } else if (nums[i] == secondMaximum) {
                continue;
            } else if (thirdMaximum == null || nums[i] > thirdMaximum) {
                thirdMaximum = nums[i];
            }
        }
        if (thirdMaximum == null) {
            return firstMaximum;
        } else {
            return thirdMaximum;
        }
    }

    public static int lengthOfLastWord1(String s) {
        return s.trim().length() - s.trim().lastIndexOf(" ") - 1;
    }

    public static void reverseString(char[] s) {
        if (s.length == 0) {
            return;
        }
        int l = 0;
        int r = s.length - 1;

        do {
            int a = s[l];
            int b = s[r];
            a = a + b;
            b = a - b;
            a = a - b;
            s[l] = (char) a;
            s[r] = (char) b;
            r--;
            l++;
        } while (l < r);
    }

    public static boolean isPalindrome(String s) {
        if (s == null || s.length() == 0) return true;
        StringBuilder alphnum = new StringBuilder();

        for (int i = 0; i < s.length(); i++) {
            char a = s.charAt(i);
            if (47 < a && a < 58) {
                alphnum.append(a);
            } else if (64 < a && a < 91) {
                alphnum.append(a);
            } else if (96 < a && a < 123) {
                alphnum.append(a);
            } else {
                continue;
            }
        }


        int l = 0, r = alphnum.length() - 1;
        while (l < r) {
            char a = alphnum.charAt(l);
            char b = alphnum.charAt(r);


            if ((a - b) == 0) {
                l++;
                r--;
            } else if(Character.forDigit(a-32,16) == Character.forDigit(b,16) ){
                l++;
                r--;
            }else if(Character.forDigit(a+32,16) == Character.forDigit(b,16) ){
                l++;
                r--;
            }else {
                return false;
            }
        }

        return true;
    }

